import React from 'react';

class ExperiencePage extends React.Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    const options = {
      stringsElement: '#ExperienceHead',
      typeSpeed: 100,
      showCursor: false
    }
  }

  componentWillUnmount() {
    this.typed.destroy();
  }

  render() {
    return (
      <div className="ExperiencePage">
        <section>
          <blockquote className="Experience-head" id="ExperienceHead">
	    "Experience is part of a story from a man. A journey where chapter written. A place where friends and rivals revealed. And a method where skill achieved."
	  </blockquote> 
        </section>
      </div>
    );
  }
}

export default ExperiencePage;
